export default function UploadEvent() {

    const coverPhoto = e=>{
        const coverPhoto=e.target.files

    }
  return (
    <div>
        <form action="">
        <input type="file" onChange={e=>coverPhoto(e)}/>
        <input type="file" multiple onChange={e=>coverPhoto(e)}/>
        <input type="text" multiple />

        </form>




    </div>
  )
}
